<script>
$(document).ready(function(){

 $('.input-daterange').datepicker({
  todayBtn:'linked',
  format:'yyyy-mm-dd',
  autoclose:true
 });

   $('#applicationTable thead tr').clone(true).appendTo( '#applicationTable thead' );
    $('#applicationTable thead tr:eq(1) th').each( function (i) {
        var title = $(this).text();
        $(this).html( '<input type="text" placeholder="Search '+title+'" />' );
 
        $( 'input', this ).on( 'keyup change', function () {
            if ( table.column(i).search() !== this.value ) {
                table
                    .column(i)
                    .search( this.value )
                    .draw();
            }
        } );
    } );
 
 





          

     
        

 
    // var table = $('#applicationTable').DataTable( {
        // orderCellsTop: true,
        // fixedHeader: true
    // } );

 function load_data(from_date = '', to_date = '')
 {

  $('#applicationTable').DataTable({
     dom: 'Bfrtip',
        buttons: [
         {
                 extend: 'print',
                   messageBottom: '\nThe information in this table is copyright to UB-ETEEAP.',

                customize: function ( win ) {



                    $(win.document.body)

                        .css( 'font-size', '10pt' )
                        .prepend(
                            '<img src="https://i.ibb.co/9wnV9Xd/logo.png" style="position:center; " />'
                        );
 
                    $(win.document.body).find( 'table' )
                        .addClass( 'compact' )
                        .css( 'font-size', 'inherit' );
                }

            },
           {
                extend: 'excelHtml5',
            },
             {
                              extend: 'excelHtml5',
                exportOptions: {
                    columns: ':visible'
                }
            },
            {
                extend: 'pdfHtml5',
                customize: function ( doc ) {
                    doc.content.splice( 1, 0, {
                        margin: [ 0, 0, 0, 12 ],
                        alignment: 'center',
                        image: 'data:image/jpeg;base64,'
                    } );
                    },
                 
                

                  // messageTop: 'The information in this table is copyright to UB-ETEEAP.',
                 footer: true,

                   // messageBottom: '\nReport Generated.',
                   messageBottom: '\nThe information in this table is copyright to UB-ETEEAP.',





            },
             'colvis'
              
        ],
       

    orderCellsTop: true,
        fixedHeader: true,
        processing: true,
        serverSide: true,
        


   ajax: {
    url:'{{ route("admin.reports.index") }}',
    data:{from_date:from_date, to_date:to_date}
   },
   

   columns: [
    {

      data:'full_name',
     name:'full_name'

    },
      {
     data:'office',
     name:'office'
    },
       {
     data:'courseCode',
     name:'courseCode'
    },
    {
     data:'stage',
     name:'stage'
    },
     {
     data:'status',
     name:'status'
    },
   
   
    
    {
     data:'date',
     name:'date'
    },
    
   ]
   
  


  });


 }
 load_data();


 $('#filter').click(function(){
  var from_date = $('#from_date').val();
  var to_date = $('#to_date').val();
  if(from_date != '' &&  to_date != '')
  {
   $('#applicationTable').DataTable().destroy();
   load_data(from_date, to_date);
  }
  else
  {
   alert('Both Date is required');
  }
 });

 $('#refresh').click(function(){
  $('#from_date').val('');
  $('#to_date').val('');
  $('#applicationTable').DataTable().destroy();
  load_data();
 });

       
 

});
</script>
